import logo from './logo.svg';
import './App.css';
import React from 'react'
/* import Box from '@mui/material/Box'; */
/* import Button from '@mui/material/Button'; */
import TextField from '@material-ui/core/TextField';
/*<TextField id="standardtextfield" label="Enter qty" variant="standard" />*/
/*
*/
/*<img src={logo} className="App-logo" alt="logo" />*/

function Projects(props) {
  return (
    <header> 
      <h1>Hello {props.name}! This is the project catalog:</h1>
      <form noValidate autoComplete = "off">
        <TextField
        label = "Enter qty"
        />
      </form>
      <h3>Project 1 <button className = 'status'>Status</button></h3>
      <h3>List of Authorized Users: </h3>
      <h2 className = 'customheader'>Hardware Set 1: 100/100
      <button className = 'in'>Check In</button>
      <button className = 'out'>Check Out</button></h2>
      <h2 className = 'customheader'>Hardware Set 2: 100/100<button className = 'in'>Check In</button>
      <button className = 'out'>Check Out</button></h2>
      <h3>Project 2 <button className = 'status'>Status</button></h3>
      <h3>List of Authorized Users: </h3>
      <h2 className = 'customheader'>Hardware Set 3: 100/100<button className = 'in'>Check In</button>
      <button className = 'out'>Check Out</button></h2>
      <h2 className = 'customheader'>Hardware Set 4: 100/100<button className = 'in'>Check In</button>
      <button className = 'out'>Check Out</button></h2>
      <h3>Project 3 <button className = 'status'>Status</button></h3>
      <h3>List of Authorized Users: </h3>
      <h2 className = 'customheader'>Hardware Set 5: 100/100<button className = 'in'>Check In</button>
      <button className = 'out'>Check Out</button></h2>
      <h2 className = 'customheader'>Hardware Set 6: 100/100<button className = 'in'>Check In</button>
      <button className = 'out'>Check Out</button></h2>
    </header>
  )
}

class App extends React.Component {
  render(){
    return (
      <div className="App">
        <header className="App-header">

          <Projects name = 'User'/>
        </header>
      </div>
    );
  }
}

export default App;
